import React from 'react';
import './CSS/dashboard.css';
import SideBar from './Sidebar';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {useEffect, useState} from 'react';
import DashboardHome from './pages/DashboardHome';
import Money from './pages/Money';
import Items from './pages/Items';
import {useNavigate} from "react-router-dom"

function Dashboard() {
  const navigate = useNavigate();
  var currentUser  = ""
  function userCheck(){
      fetch('http://localhost:3001/dashboardload')
      .then (res => res.json())
      .then(res => {
        if(res=== "" || res.username  === "NaN"){
          currentUser =  ""
          navigate("/SignInSignUp");
        }
        else{
          currentUser  =  res.username;
          console.log("Welcome username: "  + res.username);
          }
    })
  }
  userCheck();
  return (
    <div>
        <SideBar>
        <Routes>
          <Route exact path='/' element ={<DashboardHome username={currentUser}/>} />
          <Route exact path="/DashboardHome" element={<DashboardHome username={currentUser}/>} />
          <Route exact path="/Money" element={<Money />} />
          <Route exact path="/Items"  element={<Items />} />
        </Routes>
        </SideBar>
    </div>
  );
}

export default Dashboard;
